import Foundation

struct FileHeaderPrinter: Printable {
    func print() -> String {
        return [
            "//",
            "// This is a generated file, do not edit!",
            "// Generated by Contract.swift, see https://github.com/daisuke310vvv/ContractSwift.git",
            "//",
            ].joined(separator: "\n")
    }
}
